import React, { Component } from 'react'

export default class Home extends Component {
  render() {
    return (
      <div>
        <header>
          <button className="signin">SIGN IN</button>
        </header>
        <main>
          <button className="todolist">CREATE YOUR TO-DO-LIST</button>
        </main>
      </div>
    )
  }
}
